import MenuIems from '../menu-items/menu-items.componenta';
import '../directory/directory.style.css'

class Directory extends React{
    constructor() {
  super();

  this.state = {
      sections :[
          {title: 'hats',
          imageUrl : <img src= "./images/hats/3" alt="" srcset=""/> ,
          id:1},
      
          {title: 'jackets',
          imageUrl : <img src= "./images/jackets/3" alt="" srcset=""/> ,
          id:2},

         {title: 'models',
         imageUrl : <img src= "./images/models/1" alt="" srcset=""/> ,
          id:3},
          
         {title: 'models',
         imageUrl : <img src= "./images/models/4" alt="" srcset=""/> ,
          id:4},

         {title: 'shoes',
          imageUrl :<img src= "./images/hats/2" alt="" srcset=""/> ,
          id:5}
        ] 
       }

 }
 render(){
     return(
        <div className ='directory-menu' >
            {this.state.sections.map(({title, imageUrl,id }) => (<menuitem key={id} title={title}/>
            
            ))}
        </div>
     )
 }

}
export default director;
